class Minyakfragment : Fragment() {

    lateinit var kategoriAdapter : KategoriAdapter


    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)

    }

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        // Inflate the layout for this fragment
        return inflater.inflate(R.layout.fragment_minyak, container, false)
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)

        val listkategori = listOf(
            Pojo.Kategori(
                name = "Minyak Bimoli",
                image = "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.blibli.com%2Fp%2Fbimoli-minyak-goreng-2-liter-1-dus-isi-6%2Fps--JAJ-46183-00605&psig=AOvVaw0piOEhb_ezKCeGvtjB1UbC&ust=1612420782157000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCNjG29qNze4CFQAAAAAdAAAAABAD"
            ),
            Pojo.Kategori(
                name = "Minyak Filma",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Minyak Forvita",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Minyak Fortune",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Minyak Sunco",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Minyak Tropical",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Minyak Sania",
                image = "data:image/jpeg;base64,"
            ),
            Pojo.Kategori(
                name = "Minyak Soya",
                image = "data:image/jpeg;base64,"
            )

        )

        val kategoriAdapter = KategoriAdapter(listkategori) {
            kategori ->
            Toast.makeText(activity, " clicked ${kategori.name},", Toast.LENGTH_SHORT).show()
            val intent = Intent(activity, DetailWarungActivity::class.java)
            intent.putExtra("kategori",kategori)
            startActivity(intent)
        }

        rv_main_minyak.apply {
            layoutManager = LinearLayoutManager(activity)
            adapter = kategoriAdapter
        }
    }
}